import React from "react";
import "./HomeFeed.css";
import VideoCard from "./VideoCard";

function HomeFeed() {
  return (
    <div className="home-feed">
      <p className="home-feed-title">Recommended</p>
      <div className="recommended-videos">
        <VideoCard 
          image = "https://i.ytimg.com/vi_webp/gVM4UIWJ4ss/maxresdefault.webp"
          title = "Salute - Dance Lesson"
          channel = "Prepix Studio"
          views = "2.3M Views"
          timestamp = "15 mins ago"
        />
      </div>
    </div>
  );
}

export default HomeFeed;
